import React, { Component } from "react";

import axios from 'axios';

// in later version, axios and most code here moved to mymain

import "bootstrap/dist/css/bootstrap.min.css";
import "../css/site.css";

class Index extends React.Component {

  static async getInitialProps () {
    // var promise = axios.get('http://localhost:4000/speakers').

    var promise = axios.get('https://www.wsjwine.com/api/address/zipcode/12345').
      then(response => {
      return {
        hasErrored: false,
        speakerData: response.data
      };
    })
    .catch(error => {
      return {
        hasErrored: true,
        message: error.message
      }
    });
    return promise;
  }

  constructor(props) {
    super(props);
    this.state = {
      hasErrored: props.hasErrored,
      message: props.message,
      speakerData: props.speakerData
    }
  }


  componentDidMount() {

  }

   componentWillUnmount() {

  }


  render() {
    return (
      <ul>
        {this.state.speakerData.map((speaker) =>
        <li key={speaker.id}>
          {speaker.firstName} {speaker.lastName}
        </li>
        )}
      </ul>
    )
  }
}

export default Index;
